import React from 'react';
import "../style/home.css"
import Navbar from './Navbar';

const Home = () => {
  return (
      <div className="home">
          <Navbar/>
          <div className="home-title">
            <div className="title-slogan"></div>
          </div>
      </div>
  );
};

export default Home;
